"   <div id=\"basicsTopicLeft\">",
"    <div id=\"topicTitle\">",
"     Patient information: Sleep apnea (The Basics)",
"    </div>",
"    <span class=\"view\">",
"     View in",
"     <a class=\"lang\" href=\"./es-419/sleep-apnea-the-basics?source=topic_page\">",
"      Spanish",
"     </a>",
"    </span>",
"    <a class=\"contributor contributor_credentials\" href=\"./authors-and-editors/patient-information\">",
"     Written by the doctors and editors at UpToDate",
"    </a>",
"    <div id=\"topicText\">",
"     <p class=\"headingAnchor\" id=\"H17011366\">",
"      <span class=\"h1\">",
"       What is sleep apnea?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Sleep apnea is a condition that makes you stop breathing for short periods while you are asleep. There are 2 types of sleep apnea. One is called &ldquo;obstructive sleep apnea,&rdquo; and the other is called &ldquo;central sleep apnea.&rdquo;",
"     </p>",
"     <p>",
"      In obstructive sleep apnea, you stop breathing because your throat narrows or closes (",
"      <a class=\"graphic graphic_figure graphicRef75747 \" href=\"UTD.htm?14/56/15237\">",
"       figure 1",
"      </a>",
"      ). In central sleep apnea, you stop breathing because your brain does not send the right signals to your muscles to make you breathe. When people talk about sleep apnea, they are usually referring to obstructive sleep apnea, which is what this article is about. &nbsp;",
"     </p>",
"     <p>",
"      People with sleep apnea do not know that they stop breathing when they are asleep. But they do sometimes wake up startled or gasping for breath. They also often hear from loved ones that they snore.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H17011482\">",
"      <span class=\"h1\">",
"       What are the symptoms of sleep apnea?",
"      </span>",
"      &nbsp;&mdash;&nbsp;The main symptoms of sleep apnea are loud snoring, tiredness, and daytime sleepiness. Other symptoms can include:",
"     </p>",
"     <p>",
"      <ul class=\"bulletCompact-block\">",
"       <li>",
"        Restless sleep",
"       </li>",
"       <li>",
"        Waking up choking or gasping",
"       </li>",
"       <li>",
"        Morning headaches, dry mouth, or sore throat",
"       </li>",
"       <li>",
"        Waking up often to urinate",
"       </li>",
"       <li>",
"        Waking up feeling unrested or groggy",
"       </li>",
"       <li>",
"        Trouble thinking clearly or remembering things",
"       </li>",
"      </ul>",
"     </p>",
"     <p>",
"      Some people with sleep apnea don&rsquo;t have symptoms, or they don&rsquo;t know they have them. They might figure that it&rsquo;s normal to be tired or to snore a lot. &nbsp;",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H17011489\">",
"      <span class=\"h1\">",
"       Should I see a doctor or nurse?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Yes. If you think you might have sleep apnea, see your doctor.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H17011496\">",
"      <span class=\"h1\">",
"       Is there a test for sleep apnea?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Yes. If your doctor or nurse suspects you have sleep apnea, he or she might send you for a &ldquo;sleep study.&rdquo; Sleep studies can sometimes be done at home, but they are usually done in a sleep lab. For the study, you spend the night in the lab, and you are hooked up to different machines that monitor your heart rate, breathing, and other body functions. The results of the test will tell your doctor or nurse if you have the disorder. &nbsp; &nbsp;",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H17011461\">",
"      <span class=\"h1\">",
"       Is there anything I can do on my own to help my sleep apnea?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Yes. Here are some things that might help:",
"     </p>",
"     <p>",
"      <ul class=\"bullet-block\">",
"       <li>",
"        Stay off your back when sleeping. (This is not always practical, because people cannot control their position while asleep. Plus, it only helps some people.)",
"       </li>",
"       <li>",
"        Lose weight, if you are overweight",
"       </li>",
"       <li>",
"        Avoid alcohol, because it can make sleep apnea worse",
"       </li>",
"      </ul>",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H17011527\">",
"      <span class=\"h1\">",
"       How is sleep apnea treated?",
"      </span>",
"      &nbsp;&mdash;&nbsp;The most effective treatment for sleep apnea is a device that keeps your airway open while you sleep. Treatment with this device is called &ldquo;continuous positive airway pressure,&rdquo; or CPAP. People getting CPAP wear a face mask at night that keeps them breathing (",
"      <a class=\"graphic graphic_figure graphicRef65324 \" href=\"UTD.htm?39/30/40419\">",
"       figure 2",
"      </a>",
"      ).",
"     </p>",
"     <p>",
"      If your doctor or nurse recommends a CPAP machine, try to be patient about using it. The mask might seem uncomfortable to wear at first, and the machine might seem noisy, but using the machine can really pay off. People with sleep apnea who use a CPAP machine feel more rested and generally feel better.",
"     </p>",
"     <p>",
"      There is also another device that you wear in your mouth called an &ldquo;oral appliance&rdquo; or &ldquo;mandibular advancement device.&rdquo; It also helps keep your airway open while you sleep.",
"     </p>",
"     <p>",
"      In rare cases, when nothing else helps, doctors recommend surgery to keep the airway open. Surgery to do this is not often effective, and even when it is, the problem can come back. &nbsp;",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H17011557\">",
"      <span class=\"h1\">",
"       Is sleep apnea dangerous?",
"      </span>",
"      &nbsp;&mdash;&nbsp;It can be. People with sleep apnea do not get good-quality sleep, so they are often tired and not alert. This puts them at risk for car accidents and other types of accidents. Plus, studies show that people with sleep apnea are more likely than others to have high blood pressure, heart attacks, and other serious heart problems. In people with severe sleep apnea, getting treated (for example with a CPAP machine) can help prevent some of these problems. &nbsp;",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H17011387\">",
"      <span class=\"h1\">",
"       More on this topic",
"      </span>",
"     </p>",
"     <p>",
"      <a class=\"medical medical_basics\" href=\"UTD.htm?21/58/22434?source=see_link\">",
