"      </a>",
"      <br/>",
"      <a class=\"medical medical_basics\" href=\"UTD.htm?38/4/38978?source=see_link\">",
"       Patient information: Daytime sleepiness (The Basics)",
"      </a>",
"      <br/>",
"      <a class=\"medical medical_basics\" href=\"UTD.htm?35/5/35921?source=see_link\">",
