"      </a>",
"     </p>",
"     <p>",
"      <a class=\"medical medical_patient\" href=\"UTD.htm?25/25/26003?source=see_link\">",
"       Patient information: Sleep apnea in adults (Beyond the Basics)",
"      </a>",
"     </p>",
