"          Percentile &gt;= 97:",
"         </span>",
"        </td>",
"        <td align=\"left\" style=\"border-left: 0px;\">",
"         <span class=\"medCalcFontOne\">",
"          Macrocephaly",
"         </span>",
"        </td>",
"       </tr>",
