"        <td align=\"center\">",
"         - 3.0",
"        </td>",
"        <td align=\"center\">",
"         0.3",
"        </td>",
"       </tr>",
"       <tr>",
"        <td align=\"center\">",
"         - 2.0",
"        </td>",
"        <td align=\"center\">",
"         2.5",
"        </td>",
"       </tr>",
"       <tr>",
"        <td align=\"center\">",
"         + 2.0",
"        </td>",
"        <td align=\"center\">",
"         97.5",
"        </td>",
"       </tr>",
"       <tr>",
"        <td align=\"center\">",
"         + 3.0",
"        </td>",
"        <td align=\"center\">",
"         99.7",
"        </td>",
"       </tr>",
"      </table>",
"     </center>",
"     <br/>",
"     &nbsp;",
"     <br/>",
