var title_f16_25_16795="Seafood advisory for pregnant women";
var content_f16_25_16795=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=OBGYN%2F53648&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=OBGYN%2F53648&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    United States Food and Drug Administration Advisory on Fish consumption in Pregnancy",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tr>",
"      <td>",
"       1. Do not eat Shark, Swordfish, King Mackerel, or Tilefish because they contain high levels of mercury.",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"sublist1_start\">",
"       2. Eat up to 12 ounces (2 average meals) a week of a variety of fish and shellfish that are lower in mercury.",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"sublist2\">",
"       &bull; Five of the most commonly eaten fish that are low in mercury are shrimp, canned light tuna, salmon, pollock, and catfish.",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"sublist2\">",
"       &bull; Another commonly eaten fish, albacore (\"white\") tuna has more mercury than canned light tuna. So, when choosing your two meals of fish and shellfish, you may eat up to 6 ounces (one average meal) of albacore tuna per week.",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       3. Check local advisories about the safety of fish caught by family and friends in your local lakes, rivers, and coastal areas. If no advice is available, eat up to 6 ounces (one average meal) per week of fish you catch from local waters, but don't consume any other fish during that week.",
"      </td>",
"     </tr>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"     Note: although not specifically mentioned in the advisory, herring, Atlantic mackerel, and sardines are also low in mercury but high in n-3 long chain polyunsaturated fatty acids.",
"    </div>",
"    <div class=\"reference\">",
"     Reproduced from: What fish should pregnant women avoid? Available at",
"     <a href=\"file://www.fda.gov\">",
"      www.fda.gov",
"     </a>",
"     . Last update 11/23/2009",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
