var title_f16_25_16796="PCV7 to PCV13 transition";
var content_f16_25_16796=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=PEDS%2F51781&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=5\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=PEDS%2F51781&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=5\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Recommended transition schedule from 7-valent pneumococcal conjugate vaccine (PCV7) to 13-valent vaccine (PCV13) vaccination among infants and children, according to number of previous PCV7 doses received - Advisory Committee on Immunization Practices",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1\" colspan=\"3\">",
"        Infant series",
"       </td>",
"       <td class=\"subtitle1\">",
"        Booster dose",
"       </td>",
"       <td class=\"subtitle1\">",
"        Supplemental PCV13 dose",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2\">",
"        2 months",
"       </td>",
"       <td class=\"subtitle2\">",
"        4 months",
"       </td>",
"       <td class=\"subtitle2\">",
"        6 months",
"       </td>",
"       <td class=\"subtitle2\">",
"        &ge;12 months*",
"       </td>",
"       <td class=\"subtitle2\">",
"        14 to 59 months",
"        <sup>",
"         &bull;",
"        </sup>",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        PCV7",
"       </td>",
"       <td>",
"        PCV13",
"       </td>",
"       <td>",
"        PCV13",
"       </td>",
"       <td>",
"        PCV13",
"       </td>",
"       <td>",
"        -",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        PCV7",
"       </td>",
"       <td>",
"        PCV7",
"       </td>",
"       <td>",
"        PCV13",
"       </td>",
"       <td>",
"        PCV13",
"       </td>",
"       <td>",
"        -",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        PCV7",
"       </td>",
"       <td>",
"        PCV7",
"       </td>",
"       <td>",
"        PCV7",
"       </td>",
"       <td>",
"        PCV13",
"       </td>",
"       <td>",
"        -",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        PCV7",
"       </td>",
"       <td>",
"        PCV7",
"       </td>",
"       <td>",
"        PCV7",
"       </td>",
"       <td>",
"        PCV7",
"       </td>",
"       <td>",
"        PCV13",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"     * No additional PCV13 doses are indicated for children age 12 to 23 months who have received 2 or 3 doses of PCV7 or PCV13 before age 12 months and at least 1 dose of PCV13 at age &ge;12 months.",
"     <br>",
"      <font class=\"bullet\">",
"       &bull;",
"      </font>",
"      For children with underlying medical conditions, a single supplemental PCV13 dose is recommended through age 71 months. Underlying medical conditions include chronic heart disease (particularly cyanotic congenital heart disease and cardiac failure), chronic lung disease (including asthma if treated with prolonged high-dose oral corticosteroids), diabetes mellitus, cerebrospinal fluid leaks, cochlear implant, children with functional or anatomic asplenia, and children with immunocompromising conditions.",
"     </br>",
"    </div>",
"    <div class=\"reference\">",
"     Centers for Disease Control and Prevention. Licensure of a 13-valent pneumococcal conjugate vaccine (PCV13) and recommendations for use among children - Advisory Committee on Immunization Practices (ACIP), 2010. MMWR 2010; 59:260.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
